import React from 'react';

// import Product from './Product';

export const ItemGrid = props => {
    return (
        <section className='itemgrid'>
            <div className='container grid-three-column'>
                {props.children}
            </div>
            <button className="main-btn-light-bc">
                <a href="#more products">
                    more products
                </a>
            </button>
        </section>
    );
}
